const groupSet = new Set(d3net.nodes.map((n) => n.group));
export const d3netTypes = [...groupSet];

const linkTypes = ['leng', 'l', 'lengt', 'le', 'len', 'length'];

export default function d3netGraphData() {
  const nodeTypeMap = new Map();
  const graph = new Graph('d3net');
  for (const n of d3net.nodes) {
    graph.addNode({ id: n.id, type: n.group, data: { ...n } });
    nodeTypeMap.set(n.id, n.group);
  }
  for (const l of d3net.links) {
    graph.addLink({
      fromId: l.source,
      fromType: nodeTypeMap.get(l.source),
      toId: l.target,
      toType: nodeTypeMap.get(l.target),
      type: linkTypes[Math.floor(Math.random() * linkTypes.length)],
      discriminator: '',
      directed: true,
      data: { value: l.value },
    });
  }

  return graph;
}
